    [],nt"revision_timestamp": "2016-07-27T22:52:03.436985",nt"name": "flint-hills-national-wildlife-refuge-annual-narrative-report-calendar-year-1977",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Flint Hills NWR
    outlines Refuge accomplishments during the 1977 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, and the system status. Construction and maintenance are also described.
    Habitat management is covered; croplands, grasslands, wetlands, and forests are
    discussed. The wildlife section of the report discusses migratory birds, mammals,
    and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, brochures, and safety
    information are attached.",nt"license_title": "License Not Specified",nt"extras":
